import './App.css';
//import PrimButton from './Components/Button'
import { Button } from '@material-ui/core';
import {  BrowserRouter as Router ,Switch, Route} from "react-router-dom";
import { Link } from "react-router-dom";

import LoginPage from './Views/LoginPage'
import MemberRegistration from './Views/MemberRegistration'
import SignUpPage from './Views/SignUpPage'

import { List as LS } from '@material-ui/core';
import { ListItem } from '@material-ui/core';
import PrimButton from './Components/Button';



function App() {
  return (
    <div className="App">
    <Router>

    <Button onClick={()=>{window.location.href = "/MemberRegistration"}}>
      REDIRECTOR
    </Button>

    <PrimButton message ="HOE" onClick={
      ()=>{
            window.location.href = "/MemberRegistration"
          }
      }
    >

    </PrimButton>


      <LS color="primary">
            <ListItem><Link to="/" >LoginPage</Link></ListItem>
            <ListItem><Link to="/SignUpPages" >SignUpPages</Link></ListItem>        
            <ListItem><Link to="/MemberRegistration" >MemberRegistration</Link></ListItem>                          
      </LS>


      <Switch>

        <Route exact path = "/" >
            <LoginPage/>             
        </Route>

        <Route exact path = "/SignUpPages">
            <SignUpPage/>
        </Route>

        <Route exact path = "/MemberRegistration" >
            <MemberRegistration/>
        </Route>

      </Switch>
     </Router>

    </div>
  );
}

export default App;
